import React from 'react';
import { Route } from 'react-router-dom';
import PageFirst from "./PageFirst";
import PageSecond from "./PageSecond";

const App = () =>{
    return(
        <>
        <switch>
            <Route exact ="/table" component={PageFirst} />
            <Route exact ="/pie" component={PageSecond} />

        </switch>

        </>

    )
};

export default App;
